import { Audio } from 'react-loader-spinner';
export const ChatOutput = (props) => {
    console.log(props);
    const serverResponse = props.message.serverResponse;
    return (
        <div className="chatoutput">
            <div className="user-input">
                {props.message.userInput}
            </div>
            <div className="server-output">
                {serverResponse === "loading" ? (
                    <div className="loading-component">Loading...</div>
                ) : (
                    serverResponse
                )}
            </div>
        </div>
    )
}
